            // }
            // else {
                // l = r;
            // }
            // r++;
        // }
        // return maxP;
    // }



    // Dynamic Programming
    // Time Complexity: O(n)
    // Space Complexity: O(1)
    public int maxProfit(int[] prices) {
        int maxP = 0;
        int minSoFar = Integer.MAX_VALUE;
        for(int i = 0; i < prices.length; i++) {
            int curMax = prices[i] - minSoFar;
            maxP = Math.max(maxP, curMax);
            minSoFar = Math.min(minSoFar, prices[i]);
        }
        return maxP;
    }

}
